import React, { Component } from 'react';

class TableHeader extends Component {
    render() {
        return (
            <Row>
                <Col>Set #</Col>
                <Col>% of max</Col>
                <Col>Reps</Col>
                <Col>Weight</Col>
            </Row>
        )
    }
}

export default TableHeader;
